INSERT INTO `tmdbmovies` (`MovieID`, `Title`, `Description`, `Popularity`, `Poster`, `Trailer`, `vote_average`, `Premiere_date`, `runtime`) VALUES
(68611, 'Huśtawka', 'Michał (Wojciech Zieliński) – ustawiony życiowo, trzydziestolatek ma piękną żonę Annę i uroczą córeczkę. Tworzą obraz wzorowej kochającej się, szczęśliwej rodziny. Los płata mu figla – poznaje Karolinę (Karolina Gorczyca) i zakochuje się w niej. Młoda fascynująca kobieta – artystka, projektantka mody, jest całkowitym przeciwieństwem Anny. Michał utrzymuje swój romans w tajemnicy, lawirując pomiędzy dwoma światami-uporządkowanym i bezpieczny, z kochającą żoną i paroletnią córeczką, a spontanicznym i artystycznie niepokornym, energicznej Karoliny. W którymś momencie sytuacja jednak się komplikuje. Anna zaczyna podejrzewać, że jest zdradzana, a Karolina stawia mu ultimatum. Tym razem Michał będzie musiał dokonać wyboru…', 0, 'http://image.tmdb.org/t/p/w500/fjNGcN4cJB873YsHEZF8ECtKtDt.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=3fKMyU2SedY"]', 4.5, '2010-09-17', 94),
(391653, 'Powrót wilczycy', 'Kraków, II połowa XIX wieku. Młody artysta Kamil przygotowuje się do ślubu z Krystyną. Przybywają do pałacu Stefani Ziembalskiej, kuzynki Kamila. W pałacu tym niegdyś straszyła wilczyca Julia, zanim została unieszkodliwiona. W nocy Krystyna zostaje zaatakowana przez coś o wyglądzie wilkołaka.', 1, 'http://image.tmdb.org/t/p/w500/wygwpIDAgdJFoj52GCpnlwkAD9q.jpg', NULL, 0, '1990-10-25', 90),
(375052, 'Powrót wabiszczura', '', 0, 'http://image.tmdb.org/t/p/w500/b2w4Tannl50XI5LICpS2S6KHDH8.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=5ev-CPk-c3M"]', 0, '1989-12-18', NULL),
(484306, 'Powrót Agnieszki H.', '', 0, NULL, NULL, 0, '2013-10-01', NULL),
(212945, 'Powrót syna marnotrawnego', 'Ten film to oparta na przypowieści Jezusa historia współczesnego syna marnotrawnego. Młody David Barker, wychowany w chrześcijańskiej rodzinie, zaczyna przyjaźnić się z ludźmi, którzy prowadzą życie sprzeczne z zasadami Bożymi.\r Stopniowo upodabnia się do swoich nowych znajomych. Jak zareagują jego bliscy? Czy David się opamięta? Czego z tej historii możemy się nauczyć o niebezpieczeństwach, na jakie narażeni są dziś młodzi ludzie?', 0, 'http://image.tmdb.org/t/p/w500/1bK5OqYKmvCGYhrtjj6x1OaR97S.jpg', NULL, 0, '0000-00-00', 104),
(238299, 'Powrót', 'Oparty na faktach film przedstawia historię deportacji narodu krymsko-tatarskiego, zarządzonej przez Stalina w 1944 roku. Głównym bohaterem filmu jest jest Sułtan Amet-Chan (postać autentyczna) - pilot radzieckiego myśliwca, dwukrotnie odznaczony najwyższym odznaczeniem radzieckim - gwiazdą bohatera ZSRR. W maju 1944 roku, po wyzwoleniu Sewastopola spod niemieckiej okupacji, Amethan przyjeżdża na kilka dni do rodzimej Ałupki. Mimowolnie staje się świadkiem deportacji Tatarów krymskich.', 0, 'http://image.tmdb.org/t/p/w500/dsVozzGEXquIyXRLfz7OFu46HRL.jpg', NULL, 5, '2013-05-18', 89),
(257087, 'Powrót do Heaven''s Veil', 'W przeszłości dziewczyna cudem wyszła cało z aktu masowego samobójstwa, dokonanego przez członków kultu religijnego. Teraz postanawia powrócić na miejsce tragedii wraz z ekipą filmową, planującą realizację dokumentu.', 7, 'http://image.tmdb.org/t/p/w500/kdm4LBCphAzvr2XbGi6eRJNXeXE.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=rOUHGzoP0fw"]', 4.5, '2016-04-21', 0),
(228028, 'Powrót Do Młodości', 'Akcja skupia się na Jimie Owensie, który nieoczekiwanie wpada na 15-lecie liceum. Rozpoczyna się szereg komicznych sytuacji, gdy bohater ze swoimi przyjaciółmi, którzy są w stałych związkach, szykują ostatnią szaloną zabawę. W planach między innymi zemsta na dawnym dyrektorze szkoły oraz prawdopodobne odwołanie ślubu, gdy Jim ponownie zakochuje się w swojej miłości z liceum.', 2, 'http://image.tmdb.org/t/p/w500/e1lSLyv3Jrsmtjx5NMPKpukGj2h.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=3cMwPaqcx4c"]', 5.4, '2014-01-07', 0),
(1452, 'Superman: Powrót', 'Superman (Człowiek ze Stali) powraca na Ziemię po sześciu latach nieobecności. W czasie kiedy nie było go na Ziemi, zło rozprzestrzeniło się tutaj z wielką mocą. Nawet Lex Luthor, niegdyś wyrzutek, jest teraz jednym z najpotężniejszych ludzi w Metropolis. Kiedy w mieście pojawia się stary wróg Supermana z planety Krypton, superbohater na nowo musi rozpocząć swoją niekończącą się walkę ze złem.', 23, 'http://image.tmdb.org/t/p/w500/qE6DQvuD8JReVrvBVWwvHXMxGnQ.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=zVCozSQj8TQ","https:\\/\\/www.youtube.com\\/watch?v=_z4LafXkU6c"]', 5.4, '2006-06-28', 154),
(79896, 'Powrót trupa', 'Bart Gregory (David Anders), ginie podczas wojny, w czasie wykonywania misji na Bliskim Wschodzie. Mężczyzna zostaje pochowany ze wszystkimi honorami należnymi żołnierzom. Okazuje się jednak że Bart nie chce pożegnać się z światem żywych i powraca jako ktoś zupełnie inny.', 5, 'http://image.tmdb.org/t/p/w500/tNN8I20NLa9ABaRMajnCB9C4wLT.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=bN1ZV-aYooY"]', 6.3, '2009-08-16', 110),
(401, 'Powrót do Garden State', 'Żyjący w Los Angeles, początkujący aktor Andrew "Large" Largeman (Zach Braff) zmuszony jest do odbycia swoistej podróży sentymentalnej do rodzinnego New Jersey. Nieuchronnie zbliża się do unikanej przez lata konfrontacji z ojcem (Ian Holm - Aviator). Na każdym kroku spotyka starych znajomych, tworzących specyficzną mozaikę osobowości. Zbieg okoliczności łączy go także z losem Sam (Natalie Portman), dziwnej dziewczyny, za sprawą której Large znajduje w sobie dość odwagi, by otworzyć swe serce i umysł na doświadczenia niesione przez życie.', 21, 'http://image.tmdb.org/t/p/w500/u7IASCZ02Q94SYklSIR2609inis.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=zCEfj5o1L08"]', 7.1, '2004-07-28', 102),
(10643, 'Powrót Godzilli', 'Japoński naukowiec Shinoda stoi na czele grupy GPN - Godzilla Prediction Network (Grupa Obserwatorów Godzilli - GOG). Próbuje on odgadnąć motywy postępowania Godzilli i przewidzieć, gdzie się ona pojawi. Jego celem jest zbadanie natury potwora i ochranianie go. Tymczasem Godzilla, potężny, niezniszczalny jaszczur wychodzi z kryjówki w głębinach oceanu. Shinoda razem z nastoletnią córką Yo, która pomaga mu w pracach badawczych i z dziennikarką Yuko, która za wszelką cenę chce zrobić zdjęcie Godzilli, podąża jej śladem. Shinoda próbuje powstrzymać Katagiriego, szefa CCI (Crisis Control Intelligence) - Agencji Bezpieczeństwa Narodowego przed zniszczeniem Godzilli. Katagiri postawił sobie za cel jej zabicie, bez względu na konsekwencje. Z dna morza wynurza się też meteor, który ma 60 milionów lat i zmienia się we wrogi Ziemi statek kosmiczny. Ze statku zaś wychodzi Orga - gigantyczne, śmiertelnie niebezpieczne stworzenie. Japonia pogrąża się w panice i w chaosie. Pomóc może tylko Godzilla.', 3, 'http://image.tmdb.org/t/p/w500/iFqf6rOnVdBGR3PIqn1eRUffuaH.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=akes6lbGjaY"]', 5.8, '1999-12-11', 0),
(383869, 'Powrót do Mamy', '', 8, 'http://image.tmdb.org/t/p/w500/75e91EITkWkS9fYIx3jAm9vhTFb.jpg', NULL, 5.5, '2016-06-01', 0),
(79451, 'Powrót pułkownika Sharpe''a', 'Szesnasty z serii filmów o przygodach dzielnego brytyjskiego oficera, Richarda Sharpe''a.  Po zwycięskim zakończeniu walk z majorem Doddem, Richard Sharpe i Patrick Harper szykują się do powrotu z Indii do Anglii. Decydują się wykonać jeszcze jedno ostatnie zadanie. Podejmują się eskorty francuskiej damy do fortu w Kalimgong, gdzie stacjonuje jej narzeczony, major Joubert. Po drodze napotykają konwój złożony z żołnierzy brytyjskich, zmierzający do Madrasu. Wkrótce zostają zaatakowani przez rozbójników lokalnego bandyty Chitu. Sharpe, jako najbardziej doświadczony oficer, zmuszony jest objąć dowodzenie nad konwojem.', 1, 'http://image.tmdb.org/t/p/w500/aEhCdmTRIzmwsYQ8cWkGGOXQ1r5.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=5gKdCbqgsnw"]', 6, '2008-11-02', 0),
(78504, 'Powrót', 'Do miasteczka przyjeżdża pisarz powieści kryminalnych, który zafascynowany jest zagadką kilku brutalnych morderstw. W rozwiązaniu sprawy pomaga mu barmanka, Heather.', 1, 'http://image.tmdb.org/t/p/w500/1g7CGtTXYoHtqoHhLVZi3FLHN2v.jpg', NULL, 3.8, '2011-10-28', 101),
(40696, 'Pippi Langstrumpf - Powrót Pippi', 'Pippi nie opuszcza swej willi i przyjaciół. Jednak olbrzymia torba pełna złotych monet to łakomy kąsek dla zbiegłych z więzienia opryszków. Ale nie tak prosto jest przechytrzyć małą Pippi...', 2, 'http://image.tmdb.org/t/p/w500/zpl3rMcuemCb9oSrJuaeTkKiMQg.jpg', NULL, 6.4, '1969-10-31', 83),
(364, 'Powrót Batmana', 'Miasteczko Gotham opanowały groźne stwory: dziwaczny i zarazem przerażający Pingwin, oraz zwinna i tajemnicza Kobieta-Kot. To właśnie tę parę musi pokonać Batman. Zadanie jest tym trudniejsze, że nie sposób oprzeć się zniewalającemu urokowi Kobiety-Kota, a Pingwin wprowadza w czyn swe niecne plany.', 24, 'http://image.tmdb.org/t/p/w500/ifzddUhnsTf1h6guBUKBlDwuS1t.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=TlbtLfWvFbo"]', 6.7, '1992-06-19', 126),
(105, 'Powrót do przyszłości', 'Marty McFly (Michael J. Fox) jest typowym nastolatkiem, ale ma niezwykłego przyjaciela - Dr Emmetta Browna (Christopher Lloyd), który wynalazł wehikuł czasu. W nocy przed centrum handlowym Dr. Brown pokazuje swój wynalazek Martyemu. Wygląda on jak udoskonalony samochód, a działa na... pluton. Dr. Brown zwędził go Libijczykom, którzy chcieli, aby zrobił im bombę atomową. Podczas eksperymentu terroryści zabijają doktora. Marty cudem uchodzi z życiem, ale przenosi się do roku 1955. Szukając Dr. Browna z lat pięćdziesiątych natyka się na rodziców i zapobiega ich poznaniu. W wyniku tego może się nigdy nie urodzić...', 42, 'http://image.tmdb.org/t/p/w500/pTpxQB1N0waaSc3OSn0e9oc8kx9.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=qvsgGtivCgs","https:\\/\\/www.youtube.com\\/watch?v=XVUtNk_6mpc","https:\\/\\/www.youtube.com\\/watch?v=AM28GvL8oCM","https:\\/\\/www.youtube.com\\/watch?v=GdccQODQsIw"]', 8.1, '1985-07-03', 116),
(11190, 'Powrót', 'Film opowiada historię dwóch nastoletnich chłopców, których ojciec niespodziewanie powraca do domu po dwunastu latach nieobecności. Już następnego dnia zabiera synów w daleką podróż na opuszczoną wyspę. Z każdym kolejnym dniem cel wspólnego wyjazdu wydaje się braciom coraz bardziej zagadkowy, a czas spędzony z nagle odzyskanym ojcem staje się dla nich sprawdzianem dojrzałości i męskości. Będą się tu ścierać miłość i nienawiść, ambicje i charaktery, potrzeba autorytetu z potrzebą wolności.', 6, 'http://image.tmdb.org/t/p/w500/wNvGhhhh6mCloDBfCW5i9HpyvU7.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=qNR4ER9tC6A"]', 7.4, '2003-06-25', 105),
(292010, 'Powrót', '', 3, 'http://image.tmdb.org/t/p/w500/x5uDHJrzBfFNCzx3MLUXCTFbdOO.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=TaC-SrFdRZg"]', 6.4, '2015-10-09', 0),
(101669, 'Powrót zła', 'Kiedy trójka braci napada na bank, jeden z nich zostaję postrzelony. Mężczyźni wracają do rodzinnego domu, który zamieszkują nowi właściciele.', 11, 'http://image.tmdb.org/t/p/w500/tqeVlz9OpZslSxusMg4y6e833LI.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=TcdfNJx68VM"]', 6.3, '2010-09-23', 112),
(141052, 'Liga Sprawiedliwości', 'Zainspirowany ofiarnym czynem Supermana Bruce Wayne odzyskał wiarę w ludzkość. Prosi swojego nowego sprzymierzeńca, Dianę Prince, o pomoc w pokonaniu jeszcze potężniejszego wroga. Nie tracąc czasu, Batman i Wonder Woman starają się znaleźć i przekonać do współpracy grupę metaludzi, która ma stanąć do walki z nowym zagrożeniem. Jednak mimo utworzenia jedynej w swoim rodzaju ligi superbohaterów, złożonej z Batmana, Wonder Woman, Aquamana, Cyborga i Flasha, może być już za późno na uratowanie planety przed atakiem katastroficznych rozmiarów.', 311, 'http://image.tmdb.org/t/p/w500/1sKgyz3XNPGycTjbDjo42mmkYj7.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=u280uGDxUcc"]', 6.5, '2017-11-15', 120),
(408220, 'Liga Sprawiedliwości: Mrok', 'Kiedy niewinni cywile zaczynają popełniać niewyobrażalne przestępstwa w Metropolis, Gotham City i innych metropoliach, Batman musi wezwać mistycznych bohaterów, by wyeliminować demoniczne zagrożenie.', 12, 'http://image.tmdb.org/t/p/w500/lGa2sK2LdcHQjasYyukl3P2nras.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=cddLDL_kKOU","https:\\/\\/www.youtube.com\\/watch?v=w5xyNvjcqCg","https:\\/\\/www.youtube.com\\/watch?v=D-5aTKSD4ww"]', 7, '2017-01-24', 0),
(284053, 'Thor: Ragnarok', 'Thor zostaje uwięziony po drugiej stronie wszechświata. Osłabiony i pozbawiony młota musi znaleźć sposób, by powrócić do Asgardu i stawić czoła bezwzględnej i wszechpotężnej Heli oraz powstrzymać Ragnarok – "zmierzch bogów", zagładę świata i całej asgardzkiej cywilizacji. Przedtem jednak musi stanąć do gladiatorskiego pojedynku na śmierć i życie z byłym sprzymierzeńcem i członkiem drużyny Avengers — niesamowitym Hulkiem!  [opis dystrybutora kino]', 187, 'http://image.tmdb.org/t/p/w500/oSLd5GYGsiGgzDPKTwQh7wamO8t.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=ue80QwXMRHg","https:\\/\\/www.youtube.com\\/watch?v=INUvFbLkZNU","https:\\/\\/www.youtube.com\\/watch?v=v7MGUNV8MxU","https:\\/\\/www.youtube.com\\/watch?v=gFaYbSGjED0"]', 7.4, '2017-10-25', 148),
(335984, 'Blade Runner 2049', 'Akcja filmu rozgrywa się 30 lat po wydarzeniach z pierwszego Blade Runnera (1982). Oficer policji Los Angeles, niejaki K, trafia na ukrywaną przez lata informację, która może pogrążyć resztki społeczeństwa w chaosie. Jego odkrycie prowadzi go do poszukiwań Ricka Deckarda, byłego łowcy androidów, który zaginął 30 lat temu.', 103, 'http://image.tmdb.org/t/p/w500/aMpyrCizvSdc0UIMblJ1srVgAEF.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=Sn3fCrbNCvE"]', 7.5, '2017-10-04', 163),
(475759, '2048: Nowhere to Run', '', 5, 'http://image.tmdb.org/t/p/w500/5FTBLf0fnBbOmKrIuXLCrdxEUqT.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=aZ9Os8cP_gg"]', 6.6, '2017-09-14', NULL),
(473072, '2036: Nexus Dawn', '', 5, 'http://image.tmdb.org/t/p/w500/uLlJdlYPa63GCi01tx98cxJT57u.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=UgsS3nhRRzQ"]', 6.9, '2017-08-29', NULL),
(181808, 'Gwiezdne wojny: Część VIII - Ostatni Jedi', 'Rey, którą poznaliśmy w filmie Gwiezdne wojny: Przebudzenie mocy (2015) oraz Finn, Poe i Luke Skywalker kontynuują swoją wielką podróż w kolejnej odsłonie gwiezdnej sagi.', 739, 'http://image.tmdb.org/t/p/w500/gW3SSNKtldFHtY28pFDFunngJH3.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=IcF-cPP5_1E","https:\\/\\/www.youtube.com\\/watch?v=G_52TS4Vne8"]', 7.4, '2017-12-13', 150),
(335988, 'Transformers: Ostatni Rycerz', 'Optiums Prime odszedł, a między ludźmi i Transformerami toczy się walka o przetrwanie. Cade Yeager tworzy sojusz z Bumblebee oraz brytyjskim lordem i oksfordzką profesorką, aby dowiedzieć się dlaczego Transformery wciąż wracają na Ziemię.', 32, 'http://image.tmdb.org/t/p/w500/wQ0fXIxOrM9e0BIy7rUbWZmSGwi.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=3tsLaecUC8k","https:\\/\\/www.youtube.com\\/watch?v=bJjeYD8Gfz4","https:\\/\\/www.youtube.com\\/watch?v=3kJmXJnqPlg"]', 6.1, '2017-06-16', 148),
(480973, 'Listy do M. 3', '"Listy do M. 3" opowie historię kilku osób, którym w jeden magiczny dzień przydarzają się wyjątkowe chwile. Bohaterowie przekonają się o potędze miłości, rodziny, wybaczenia i wiary w to, że ten niezwykły świąteczny czas pełen jest niespodzianek.', 1, 'http://image.tmdb.org/t/p/w500/xskj1hafXjDxTHYNcCPqzfPC44J.jpg', NULL, 6.3, '2017-11-10', 107),
(392044, 'Morderstwo w Orient Expressie', 'Genialny belgijski detektyw Herkules Poirot bada morderstwo amerykańskiego potentata na pokładzie pociągu Orient Express.', 37, 'http://image.tmdb.org/t/p/w500/mqPUxPvyYJD5srqi0YSGlUKBbdF.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=ZReSbPq5MrI"]', 6.8, '2017-11-03', 114),
(378236, 'Emotki. Film', 'Wszyscy mamy emocje. Okazuje się, że mają je także… emotikony. Animowana komedia zabierze nas do sekretnego świata naszych telefonów. Czeka nas mnóstwo, cóż, emocji właśnie i przygód, jakie tylko możemy sobie wyobrazić, zaglądając do naszych telefonów.', 38, 'http://image.tmdb.org/t/p/w500/mwDi4wiXp0A02UsowhWivAe37HW.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=1-ZArk73bLc"]', 5.6, '2017-07-23', 0),
(440021, 'Śmierć nadejdzie dziś', 'Studentka college’u (znana z „La La Land” Jessica Rothe) każdego dnia na nowo budzi się w dniu swojej śmierci, powoli odkrywając niezwykłe szczegóły przyczyn zabójstwa, by wreszcie odkryć tożsamość mordercy i jego motywy.', 30, 'http://image.tmdb.org/t/p/w500/nGsqGFmSUM1MLmtLHKmTsCts6Zr.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=21gnLfqAcS4"]', 6.3, '2017-10-12', 96),
(372343, 'Pierwszy śnieg', 'Detektyw Harry Hole bada sprawę zaginięcia kobiety, której szalika użyto do przystrojenia ulepionego przed jej domem bałwana.', 28, 'http://image.tmdb.org/t/p/w500/jemHdcfnRaTeUvbzZxj2H4yzs67.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=jp3XHZ7spKk"]', 4.9, '2017-10-12', 119),
(470360, 'Najlepszy', 'Głównym bohaterem filmu jest sportowiec, który zachwycił świat, a który w Polsce, do dziś, pozostaje osobą praktycznie nieznaną. To fascynująca, pełna morderczego wysiłku, spektakularnych upadków i niezwykłej siły, historia inspirowana życiem Jerzego Górskiego, który ukończył bieg śmierci oraz ustanowił rekord świata w triathlonowych mistrzostwach świata, zdobywając tytuł mistrza na dystansie Double Ironman z czasem 24h:47min:46sek. Ten rekord nie byłby jednak możliwy, gdyby w jego życiu nie pojawiły się dwie kobiety. Jedną stracił. Druga stała się inspiracją, aby zawalczył o swoje życie.', 1, 'http://image.tmdb.org/t/p/w500/okqbuPEUUD22gwRRYYAKbqV72Rq.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=JMCj75fvuOY"]', 9, '2017-11-17', 110),
(335360, 'My Little Pony. Film', 'Stadko dzielnych kucyków staje oko w oko ze swoim największym wrogiem. Złowrogi Król Burzy postanawia wykraść całą magię z ich rodzinnego królestwa Equestrii. By ją odzyskać, dzielni bohaterowie wyruszą w pełną przygód podróż, podczas której zyskają nowych przyjaciół jak morskie kucyki czy dobroduszni piraci, przeżyją wiele emocjonujących i zabawnych perypetii i po raz kolejny udowodnią, że przyjaźń to magia!', 13, 'http://image.tmdb.org/t/p/w500/qgpSje445hMwZBtHrLFw8wklp2s.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=kIv_ConaZ1c"]', 7.5, '2017-10-05', 99),
(434848, 'Serce miłości', 'Polska, początek XXI wieku. Artystka wymykająca się zaszufladkowaniu i eksperymentujący muzyk. Dwójka outsiderów, których bardzo wiele ze sobą łączy. Androgyniczni, szczupli, bez włosów, często ubrani w identyczne uniseksy – wyglądają jak męska i żeńska wersja tej samej osoby. Ich stan zakochania przypomina perwersyjną wersję narcyzmu, bo, patrząc na kochanka, patrzą na własne odbicie. W ich relacji miłość przenika się ze sztuką. Intymnym wyznaniom i gestom nadana zostaje artystyczna forma. I odwrotnie – sztuka jest ich sposobem na życie emocjonalne. Żyją w stworzonym przez siebie świecie, w którym mogą wszystko projektować i kontrolować. Wszystko, oprócz własnych emocji.', 0, 'http://image.tmdb.org/t/p/w500/nLemlcQyUjiHd8mmFbSOayOf79b.jpg', NULL, 0, '2017-02-21', 0),
(290512, 'Pomiędzy nami góry', 'Dwoje obcych sobie ludzi, którzy wychodzą cało z tragicznej katastrofy lotniczej, uwięzionych zostaje w niedostępnych, skutych lodem górach. Kiedy uświadamiają sobie, że spodziewana pomoc nie nadejdzie, zmuszeni są wyruszyć w kilkusetkilometrową podróż przez dziką okolicę. Po drodze muszą stawić czoło nie tylko niewyobrażalnym przeciwieństwom losu, lecz także nieoczekiwanej namiętności.', 81, 'http://image.tmdb.org/t/p/w500/3EG2RN3YMoVtbFy6nwDkkZcXdo0.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=8ffEs6GfMSI","https:\\/\\/www.youtube.com\\/watch?v=zK8taXdfSI4"]', 6.7, '2017-10-05', 0),
(455825, 'Tosca: Met Opera Live', '', 1, NULL, NULL, 0, '2018-01-27', NULL),
(455831, 'Così fan tutte: Met Opera Live', '', 0, NULL, NULL, 0, '2018-03-31', NULL),
(298250, 'Piła: Dziedzictwo', 'Miasto paraliżuje strach, gdy policja odkrywa kolejne zmasakrowane zwłoki. Media rozdmuchują teorię o seryjnym mordercy, ale detekty­wom nie udaje się ustalić żadnego wspólnego mianownika, który łączyłby wszystkie zabójstwa. Aż do dnia, gdy na jaw wyjdzie jeden ma­kabryczny szczegół, który rzuci podejrzenie na dobrze znanego policji mordercę Johna Kramera. Problem w tym, że Kramer nie żyje...', 22, 'http://image.tmdb.org/t/p/w500/uQnD9QnokQMPfkyZwXVkSmph9yh.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=bWvCbSsCOl8"]', 5.9, '2017-10-20', 91),
(427900, 'Wszyscy moi mężczyźni', 'Po rozstaniu z mężem, Alice wraz z córkami opuszcza Nowy Jork. Wraca do rodzinnego domu w Los Angeles, znajduje pracę oraz szkołę dla dzieci. W dniu swoich urodzin poznaje trzech uroczych facetów, którzy przybyli do LA w pogoni za marzeniami. Cała trójka pozostaje bez dachu nad głową i Alice, wbrew rozsądkowi, pozwala im zamieszkać u siebie. Tak rozpoczyna się pasmo damsko-męskich komplikacji, które z czasem przekształcają się w coś o wiele więcej. To jednak nie koniec wrażeń. Prawdziwe emocje zaczną się, gdy do drzwi Alice zapuka jej dawny mąż. Czy dla miłości warto rozpoczynać wszystko od nowa?', 39, 'http://image.tmdb.org/t/p/w500/roWS2XuzSYgu1oqSUlGdTBDOiSY.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=4tT889WWCrM"]', 5.6, '2017-09-07', 97),
(397538, 'Borg/McEnroe. Między odwagą a szaleństwem', 'Wimbledon 1980. Cały świat wstrzymuje oddech – rozpoczyna się finałowy mecz. Björn Borg, najlepszy tenisista na świecie, będzie bronił po raz piąty tytułu mistrza. Chłodny, opanowany i skuteczny – jest ulubieńcem publiczności. Nikt jednak nie wie o dramacie rozgrywającym się poza kortem: niespełna 24-letni tenisista jest fizycznym i psychicznym wrakiem, wyniszczonym przez mordercze treningi, które rujnują także jego życie prywatne. Przeciwnik Borga to 20-letni John McEnroe, porywczy i wybuchowy, zdeterminowany, by zająć miejsce swojego dotychczasowego idola. Jaką cenę może mieć sukces?', 8, 'http://image.tmdb.org/t/p/w500/9hR2emM9MqH5LJPTjG8o7RPpksU.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=RTfD1_-lEMg","https:\\/\\/www.youtube.com\\/watch?v=APhWZS4LyEU"]', 7.2, '2017-09-06', 0),
(381283, 'Mother!', 'Uczucie wiążące młodą parę zostaje wystawione na próbę, kiedy w ich domu zjawia się nieproszony gość.', 79, 'http://image.tmdb.org/t/p/w500/qmi2dsuoyzZdJ0WFZYQazbX8ILj.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=XpICoc65uh0"]', 7, '2017-09-13', 0),
