(371560, 'Oczy matki', 'Hipnotyzująca opowieść o dziewczynie, która przeżywa traumę po śmierci matki.\r Francisca (Kika Magalhães) dorasta na farmie. Jej rodzina zajmuje się hodowlą zwierząt. Matka dziewczyny (Diana Agostini) była wcześniej chirurgiem i teraz uczy córkę podstaw anatomii. Pewnego dnia w ich domu zjawia się obwoźny sprzedawca o imieniu Charlie (Will Brill). Mężczyzna zabija matkę. Francisce i jej ojcu (Paul Nazak) udaje się go złapać. Powodowana chęcią zemsty dziewczyna pozbawia mordercę oczu oraz strun głosowych. Torturuje go przy pomocy pozostawionych przez matkę chirurgicznych narzędzi. Przeznaczony dla widzów o silnych nerwach, wymykający się schematom dramat z elementami horroru gore.', 6, 'http://image.tmdb.org/t/p/w500/pt15PaowEpZ3bGYeyUxiETkWaSk.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=cvlrIKDtffg","https:\\/\\/www.youtube.com\\/watch?v=FyU6HquTOgo","https:\\/\\/www.youtube.com\\/watch?v=eS7Li3F5X54"]', 6.2, '2016-12-02', 0),
