(346648, 'Paddington 2', 'Paddington, teraz szczęśliwie osiadły z rodziną Brown i popularnym członkiem lokalnej społeczności, podejmuje szereg dziwnych prac, aby kupić idealny prezent na setne urodziny swojej ciotki Lucy, prezent który ma zostać skradziony.', 37, 'http://image.tmdb.org/t/p/w500/bU5pSpQfXRmqDd6jthmP8iWJOjd.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=XvAL6gB2VF0"]', 7.9, '2017-11-10', 0),
(353486, 'Jumanji: Przygoda w dżungli', 'Kiedy dzieciaki odkrywają starą konsolę gier wideo z grą "Jumanji", o której nigdy dotąd nie słyszały, natychmiast przenoszą się w świat niebezpiecznej dżungli. To właśnie w niej dzieje się akcja gry, a one stają się awatarami postaci, które wybrały: zapalony gracz Spencer staje się odważnym łowcą przygód (Dwayne Johnson), fan piłki Fridge zamienia się (według własnych słów) w Einsteina (Kevin Hart), Bethany – popularna dziewczyna z sąsiedztwa – staje się profesorem w średnim wieku (Jack Black), natomiast niepozorna Martha przybiera postać nieustraszonej wojowniczki (Karen Gillan). Wkrótce odkrywają, że w Jumanji chodzi nie tylko o grę, ale przede wszystkim o przetrwanie. Aby wygrać i powrócić do realnego świata, będą musieli wyruszyć w najbardziej niebezpieczną przygodę życia, odkrywając prawdę o sobie, albo pozostać w świecie gry na zawsze…', 520, 'http://image.tmdb.org/t/p/w500/bXrZ5iHBEjH7WMidbUDQ0U2xbmr.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=2QKg5SZ_35I","https:\\/\\/www.youtube.com\\/watch?v=ubn4zeM40tk","https:\\/\\/www.youtube.com\\/watch?v=v_TJKwJwN0E"]', 6.2, '2017-12-08', 0),
(484917, 'Człowiek z magicznym pudełkiem', 'Adam jest posiadaczem starego radia, które umożliwia podróże w czasie. Podczas jednej z nich cofa się do 1952 roku. Kiedy nie może powrócić, na ratunek wyrusza jego ukochana.', 0, 'http://image.tmdb.org/t/p/w500/zI0BCqgLnhB6ZJeStFaXArJrM0.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=vD5fOIYMVNU"]', 0, '2017-10-20', 104),
(395458, 'Suburbicon', 'Tajemnica kryminalna osadzona w spokojnym rodzinnym mieście Suburbicon w latach pięćdziesiątych XX wieku, w którym najlepsze i najgorsze cechy ludzkości ukazywane są w prześmiewczy sposób, przez uczynki pozornie zwykłych ludzi. Kiedy napad na dom przynosi śmiertelną ofiarę, obraz idealnej rodziny zamienia się w szantaż, zemstę i morderstwo.', 10, 'http://image.tmdb.org/t/p/w500/a3IHgSwO5jWPLcGjKqbQ7pxVGkq.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=gLeKWW2KNt4"]', 5.3, '2017-10-26', 0),
(354912, 'Coco', 'Film opowiada o historii małego chłopca - Miguela, który próbuje rozwiązać pewną tajemnicę rodzinną. Za sprawą nieoczekiwanych wydarzeń dochodzi do spotkania chłopca i rodziny, żywej jak i martwej.', 631, 'http://image.tmdb.org/t/p/w500/eKi8dIrr8voobbaGzDpe8w0PVbC.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=zNCz4mQzfEI","https:\\/\\/www.youtube.com\\/watch?v=xlnPHQ3TLX8","https:\\/\\/www.youtube.com\\/watch?v=bvomHFZO0mk"]', 7.3, '2017-10-27', 0),
