(480974, 'Ach śpij kochanie', 'Od kilku lat w Krakowie i okolicach znikają ludzie. W sumie 67 osób. Młody śledczy Karski, wbrew swoim przełożonym, stawia hipotezę o seryjnym mordercy. Wkrótce w kręgu podejrzanych pozostaje tylko jeden człowiek: Władysław Mazurkiewicz zwany Pięknym Władkiem. To król życia, zamożny kobieciarz, szanowany obywatel, ale także człowiek o zaskakujących powiązaniach, hipnotycznym uroku i niejasnej przeszłości. Karski w trakcie śledztwa zaczyna napotykać na coraz większe trudności. Znikają dowody i akta spraw. Ludzie, którym ufał odwracają się przeciw niemu, a między nim i podejrzanym tworzy się nietypowa relacja... A w tle całej sprawy jak duch pojawia się tajemnicza piękna kobieta.', 1, 'http://image.tmdb.org/t/p/w500/pI0hao1n6V9FgeQIZdJJa1SFmbK.jpg', NULL, 0, '2017-10-20', 100),
(431530, 'Złe Mamuśki 2. Jak Przetrwać Święta', 'Idą Święta, a to w życiu każdej pani domu jak wiadomo szczególny czas. Złe mamuśki dawno jednak zrzuciły kajdany perfekcyjnej pani domu i mogłyby się tym świątecznym czasem cieszyć z drinkiem w ręce, gdyby nie fakt, że zbliżają się jeźdźcy Apokalipsy czyli ich szacowne mamusie: strażniczki rodzinnych tradycji, konserwatywne jak dąb Bartek i surowe jak treser dzikich zwierząt. Czy naszym wyzwolonym mamuśkom uda się przekabacić własne rodzicielki i przeciągnąć je na weselszą stronę mocy? Święta to czas cudów!', 15, 'http://image.tmdb.org/t/p/w500/pgCkR9RtxOPkqI20kL3mNDOGiC.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=dYQAd0Qv94s"]', 6.1, '2017-11-02', 0),
(274855, 'Geostorm', 'Kiedy katastrofalne w skutkach zmiany klimatu zaczynają zagrażać istnieniu Ziemi, rządy wszystkich państw świata jednoczą siły i tworzą program o kryptonimie Dutch Boy Program. Obejmuje on sieć satelitów otaczających całą planetę, które uzbrojono w technologie z dziedziny geoinżynierii zaprojektowane, aby powstrzymywać powstawanie klęsk żywiołowych. Po dwóch latach niezakłóconego działania system ochronny zaczyna szwankować. Zadanie usunięcia awarii zostaje powierzone dwóm braciom, którzy od dawna nie utrzymują ze sobą kontaktu. Muszą oni zdążyć rozwiązać problem, zanim olbrzymich rozmiarów geoburza pochłonie całą planetę.\r [opis dystrybutora kino]', 29, 'http://image.tmdb.org/t/p/w500/nrsx0jEaBgXq4PWo7SooSnYJTv.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=EuOlYPSEzSc","https:\\/\\/www.youtube.com\\/watch?v=Qz8cjvKJLuw","https:\\/\\/www.youtube.com\\/watch?v=lI_Yau69onQ","https:\\/\\/www.youtube.com\\/watch?v=V-CIpujhDXc","https:\\/\\/www.youtube.com\\/watch?v=VnmPUW1lAKw"]', 5.7, '2017-10-13', 109),
(444400, 'Twarz', '', 1, NULL, NULL, 0, '2018-03-08', NULL),
(339259, 'Kryptonim HHhH', 'Prawdziwa historia człowieka, który skrywał największe tajemnice III Rzeszy. Każda władza potrzebuje kogoś, kto pozostanie w cieniu i zatroszczy się o jej sekrety. Reinhard Heydrich skrycie pracuje nad stworzeniem siatki szpiegowskiej na ogromną skalę. W tajemnicy powstaje tajna organizacja, która zmieni bieg historii i wpłynie na losy milionów. Ale człowiek, w którego rękach spoczywają niebezpieczne tajemnice, staje się zagrożeniem również dla swoich przywódców.', 16, 'http://image.tmdb.org/t/p/w500/ZVQfCY2DgCjrm8w2saXvT8Ao3B.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=3GyVqaPBvyE"]', 6.7, '2017-05-25', 0),
(369192, 'Wojna płci', 'Historia rozegranego w 1973 roku meczu tenisowego pomiędzy ówczesną pierwszą rakietą świata, Billie Jean King, a byłym mistrzem i notorycznym oszustem, Bobbym Riggsem.', 52, 'http://image.tmdb.org/t/p/w500/fWy0A3VojTCb0S2MKtEJjpquubF.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=5AWP1K7FaFI"]', 7.3, '2017-09-22', 121),
(419680, 'Co Wiecie O Swoich Dziadkach?', 'Brad i Dusty muszą poradzić sobie ze swymi natrętnymi ojcami w czasie świąt Bożego Narodzenia.', 19, 'http://image.tmdb.org/t/p/w500/5dqpN0meHBGlKVPzUlwhJJswWLx.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=lb_Hq4kFcEU","https:\\/\\/www.youtube.com\\/watch?v=nHwZD4yqsV0"]', 5.6, '2017-11-09', 100),
(399057, 'Zabicie świętego jelenia', 'Colin Farrell, Nicole Kidman i Alicia Silverstone we wciskającej w fotel opowieści o człowieku stojącym przed niewyobrażalnie trudnym wyborem. Bez względu na to, jaką decyzję podejmie, stanie się sprawcą tragedii we własnej rodzinie. A wszystko za sprawą nastoletniego chłopca, który dotąd był dla niego jak syn.', 23, 'http://image.tmdb.org/t/p/w500/zidpx5K0YgKgnSGu5pY9EDlldCD.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=BpylIl4wvVg"]', 6.2, '2017-10-20', 0),
(355547, 'Pierwsza gwiazdka', '', 162, 'http://image.tmdb.org/t/p/w500/zms2RpkqjAtCsbjndTG9gAGWvnx.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=tVgQuZf5o1M","https:\\/\\/www.youtube.com\\/watch?v=9NjvYZtwk00"]', 4.6, '2017-11-15', 86),
(316029, 'Król rozrywki', 'Oryginalny musical, który ukazuje narodziny amerykańskiego przemysłu rozrywkowego. Inspirowany losami legendarnego P.T. Barnuma film ukazuje historię wizjonera, gotowego na wszystko, by urzeczywistnić ideę olśniewającego widowiska, który stał się sensacją na miarę światową.', 241, 'http://image.tmdb.org/t/p/w500/dfhztJRiElqmYW4kpvjYe1gENsD.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=jr9QtXwC9vc","https:\\/\\/www.youtube.com\\/watch?v=AXCTMGYUg9A"]', 8.1, '2017-12-20', 0),
(36389, 'Janosik. Prawdziwa historia', 'Młody Janosik, wypalony wojną, zawiedziony w miłości, trafia do zbójeckiej drużyny. Wkrótce zostaje jej przywódcą i zaczyna się cieszyć sławą dzielnego zbójnika, który przestrzega honorowego kodeksu – nikt z napadniętych nie może zginąć. Wraz ze sławą, rośnie jego uwielbienie u kobiet. Sukcesy Janosika budzą jednak zazdrość jednego z członków bandy, chciwego i butnego Huncagi... Zmysłowa, okrutna i pełna pasji, prawdziwa historia Juraja Janosika. Oparta na faktach opowieść o młodym zbójniku, którego krótkie i intensywne życie stało się legendą.', 1, 'http://image.tmdb.org/t/p/w500/2SDoPv1fEZ6I0Q142FsFSw9NCMs.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=V-ujJsqxtZU"]', 4.3, '2009-09-04', 137),
(10008, 'Demon: Historia prawdziwa', 'Jedyna historycznie udokumentowana prawdziwa historia nawiedzenia ludzi przez ducha. Dramat rodziny Bellów rozegrał się w stanie Tennessee w 1818 roku. Ich dom do dziś jest miejscem pielgrzymek tysięcy miłośników i badaczy zjawisk nadprzyrodzonych. Jest rok 1818 w Red River, Tennessee. John Bell wraz z żoną i jedyną córką Betsy wiedzie spokojne życie. Problemy zaczynają się wraz z początkiem konfliktu w jaki John wdaje się z niejaką Kate Batts. Kobieta ta uważana przez miejscowych za czarownicę rzuca klątwę na rodzinę Bellów i zapowiada jej rychły koniec. Wkrótce w domu rodziny oraz jego otoczeniu zaczynają dziać się dziwne rzeczy. Niewytłumaczalne, ciche odgłosy, przypominające oddech, jęki, kroki - z czasem zaczynają się nasilać, aby wreszcie przybrać formę brutalnych, fizycznych ataków na Johna i jego córkę Betsy. Dziewczyna jest odwiedzana przez tajemniczą dziewczynkę, widzianą tylko przez nią, a nocami prześladuje ją budzący przerażenie, czarny wilk. To dopiero początek...', 6, 'http://image.tmdb.org/t/p/w500/ZwlzrQPx9FzU4C7FDcYlgZUGjx.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=WxcfXDBqpUQ"]', 5.3, '2005-05-05', 90),
(158914, 'Prawdziwa historia króla skandali', 'Prowokator, wydawca, przedsiębiorca, mąż, kochanek, ojciec. W 1958 roku złamał kilka reguł, a w 1992 został najbogatszym Brytyjczykiem. Z miłości stworzył biznes.  Paul Raymond, nazywany "królem Soho", przez lata skutecznie obrażał brytyjską obyczajowość.  Po otwarciu pierwszego „klubu dżentelmeńskiego” stopniowo tworzył imperium klubów i czasopism erotycznych, które przyniosło mu ogromne bogactwo .  Hedonistyczny styl życia Paula Raymonda posłużył reżyserowi (Michael Winterbottom) do stworzenia olśniewającej historii człowieka, którego życie było naznaczone zarówno blichtrem i bogactwem, jak i skandalem oraz wielką tragedią.', 5, 'http://image.tmdb.org/t/p/w500/yqbUO48P2MFpm8jn9QuyJJ4zd7m.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=jKZZNNZJ03g"]', 5.1, '2013-04-26', 101),
(9803, '7 krasnoludków - Historia prawdziwa', 'Po Czerwonym Kapturku przyszedł czas na odkrycie całej prawdy o 7 krasnoludkach i Królewnie Śnieżce... Specjalna komisja śledcza powołana do zbadanie tej sprawy ujawniła fakty, których nikt się nie spodziewał. Za górami, za lasami, siedmiu krasnoludków schroniło się w lesie. Szczycik (Maciej Stuhr), Dołek (Paweł Wilczak), Knedel (Robert Makłowicz), Loczek (Jerzy Kryszak), Prezes (Cezary Morawski), Czak (Jarosław Boberek) i Młotek (Zbigniew Suszyński) wybrali własne towarzystwo nie zakłócane odgłosami łamanych serc. I żyliby sobie dalej tak spokojnie, gdyby nie nagłe pojawienie się Królewny Śnieżki (Joanna Jabłczyńska), która wywróciła do góry nogami ich uporządkowane życie. Ta sytuacja może jednak nie potrwać długo, gdyż na poszukiwanie Śnieżki wyruszył właśnie Wielki Łowczy (detektyw Krzysztof Rutkowski) wysłany przez Złą Królową (Katarzyna Figura). Ale na zamku – poza Złą Królową – czeka na Śnieżkę również wielka miłość w osobie Królewskiego Błazna (Kuba Wojewódzki).', 5, 'http://image.tmdb.org/t/p/w500/vSMUPVdqBpliZC0tRMqs6yUdL0w.jpg', NULL, 5.2, '2004-10-28', 0),
(363841, 'Gernika. Prawdziwa historia', ',,W przededniu wojny pierwszą ofiarą jest prawda".\r 1937. Hiszpania: granice zostały określone, a strony wybrane... świat już nigdy nie będzie taki sam. Realia wojny domowej to codzienność dla mieszkańców Gerniki. Amerykański dziennikarz (James D′Arcy) potajemnie współpracuje z cenzorką lokalnej prasy (María Valverde), aby działać przeciwko surowym ograniczeniom, które stają się coraz bardziej powszechne. Wszystko jednak się zmienia, gdy Niemcy atakują miasteczko i to właśnie wolność prasy staje się potężną bronią. Film powstał na podstawie historycznych zdarzeń i bombardowań mających miejsce podczas II wojny światowej.\r Na podstawie zdarzeń historycznych.', 5, 'http://image.tmdb.org/t/p/w500/h0L2vBa0MjtamyrG36h0KvrTzQA.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=EgEADDlSo2E"]', 5.2, '2016-04-26', 0),
(245706, 'Historia Prawdziwa', 'Po brutalnym zabiciu własnej rodziny Christian Longo znajduje się na liście FBI najbardziej poszukiwanych przestępców. Mężczyzna przez lata ukrywa się poza granicami USA pod nazwiskiem Finkel. W pewnym momencie jego życia pojawia się dziennikarz, Michael Finke.', 8, 'http://image.tmdb.org/t/p/w500/2kJCtB5FPfNH3LDYv2vINrtgCRD.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=Y_NiP_bqlns"]', 6.2, '2015-04-17', 100),
(10982, 'Czerwony Kapturek - Prawdziwa historia', 'Wszystkim się wydaje, że doskonale znają bajkę o Czerwonym Kapturku. Ale czy znamy prawdziwą wersję tej bajki? A może przez całe dzieciństwo byliśmy wprowadzani w błąd. Nawet w znanej wszystkim historii tkwią detale, których nie dostrzeże się na pierwszy rzut oka. W tym przypadku, zaczynamy opowieść od końca. Futrzany glina ze zwierzęcego świata prowadzi dochodzenie w sprawie zakłócenia porządku w chatce babci. Uczestnikami zdarzenia są czerwony kapturek, wilk i drwal z siekierą. Zarzuty są poważne: zakłócenie spokoju, zamiar zjedzenia babci oraz posiadanie siekiery bez pozwolenia. Wkrótce poznamy wersję dramatycznych wydarzeń w domku babci opowiedzianą przez wilka, kapturka, babcię i drwala. Okaże się, że każdy ma jakiś sekret.. wilk jako reporter szukający sensacji, babcia prowadząca podwójne życie, drwal marzący o karierze aktorskiej... Tej film obnaży prawdę o Czerwonym Kapturku.', 11, 'http://image.tmdb.org/t/p/w500/d2t8Pj5xEOJfyCemOrJk5szYkwl.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=RGV-cTSr6zg"]', 6, '2005-12-16', 0),
(109410, 'Prawdziwa historia amerykańskiej legendy', 'Historia Jackiego Robinsona, pierwszego afroamerykańskiego baseballisty, który zagrał w amerykańskiej Major League - najważniejszej amerykańskiej lidze baseballu. 42-Prawdziwa historia amerykańskiej legendy opowiada o niezwykłej, naznaczonej cierpieniem karierze jednego z najlepszych zawodników świata. Dyskryminacja rasowa i liczne kontuzje, a także historyczna chwila podpisania kontraktu z drużyną Brooklyn Dodgers, to tylko niektóre wątki tego poruszającego obrazu.', 9, 'http://image.tmdb.org/t/p/w500/vlP18ooLmvYVNnqidbot0FupY05.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=BpxSdXnykTA","https:\\/\\/www.youtube.com\\/watch?v=OS4zHpgK-mk","https:\\/\\/www.youtube.com\\/watch?v=HALfME0wjeU"]', 6.9, '2013-04-12', 128),
(9912, 'Prawdziwa historia', 'Opowieść o życiu nowozelandzkiego konstruktora Burta Munro (Hopkins), budowniczego motocykla Indian na którym w latach 70-tych podczas wyścigów Bonneville Salt Flats, rozgrywanych w stanie Utah w USA udało się pobić ówczesny rekord prędkości.', 6, 'http://image.tmdb.org/t/p/w500/h3xDXEEjppiyuRtMv6Cy5bcMTrG.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=02Yy1vihIKs"]', 7.3, '2005-10-12', 0),
(362256, 'Barca - Prawdziwa historia FC Barcelony', 'Bogato ilustrowany film dokumentalny poświęcony 115-letniej historii katalońskiego klubu FC Barcelona – jednej z najlepszych drużyn piłkarskich na świecie. Produkcja wyczerpująco zgłębia i przedstawia najważniejsze wydarzenia i postacie, które udowadniają, że Barca to "więcej niż klub" (oficjalne motto drużyny). To film o pasji, emocjach i marzeniach wszystkich ludzi, którzy ukształtowali wiekopomną historię FC Barcelony, od Joana Gampera po Leo Messiego. Oprócz najważniejszych momentów z historii klubu i omówienia tła odwiecznej rywalizacji z Realem Madryt film zwraca szczególną uwagę na ewolucję "futbolu totalnego", dzięki któremu rozwinęli skrzydła najwięksi zawodnicy wytrenowani w legendarnej szkole La Masia. Historia legendarnego piłkarskiego zespołu uzupełniona została niezwykłymi materiałami, wśród których znalazły się fragmenty meczów, zdjęcia, wywiady, atrakcyjne efekty wizualne, animacje 3D oraz niepublikowane wcześniej ekskluzywne materiały archiwalne.', 0, 'http://image.tmdb.org/t/p/w500/zPh5BoqudESbxSwAdBn9a2RpnC3.jpg', NULL, 6.3, '2015-10-08', 0),
(25353, 'Prawdziwa historia Kota w Butach', 'Młody młynarz dostaje w spadku dziwnego kota, który nie dość, że mówi, to jeszcze chodzi w butach, posiadających magiczną moc. Przy pomocy różnych sztuczek i z nieodłącznym humorem, kot pomoże swojemu nowemu panu zdobyć serce pięknej królewny, której największą życiową pasją jest taniec. Nie obejdzie się przy tym bez zasadzek, które na dzielną parę zastawiają różne typy spod ciemnej gwiazdy…', 2, 'http://image.tmdb.org/t/p/w500/2xSFCA9e9HXF9ewYq7lk7ei4wFt.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=zen6Pt4WYNA"]', 3.7, '2009-04-01', 82),
(399055, 'Kształt Wody', 'Akcja rozgrywa się u szczytu zimnej wojny, w Stanach Zjednoczonych około roku 1962. Elisa wiedzie monotonną, samotną egzystencję, a całą noc pracuje w pilnie strzeżonym, sekretnym laboratorium rządowym. Jej życie zmienia się na zawsze, gdy wraz z koleżanką z pracy, Zeldą, odkrywa, że w laboratorium przeprowadzany jest otoczony ścisłą tajemnicą eksperyment, który zaważyć może na przyszłych losach świata.', 241, 'http://image.tmdb.org/t/p/w500/sEEiHN6t4FPY73U4czYrVTIxIlU.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=DaahLDHc1zU"]', 6.9, '2017-12-01', 0),
(398818, 'Tamte dni, tamte noce', '17-letni Elio Perlman spędza lato z rodziną w domu wakacyjnym w Lombardii we Włoszech. Kiedy jego ojciec zatrudnia przystojnego doktoranta, w nastolatku zaczyna rozwijać się rosnąca atrakcja do młodego mężczyzny.', 106, 'http://image.tmdb.org/t/p/w500/tcNniniS4rfqrLH0oORikJfnIwY.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=UyCCH0WSJg8"]', 8.6, '2017-10-27', 0),
(399404, 'Darkest Hour', '', 116, 'http://image.tmdb.org/t/p/w500/67fPL6ZaiOeM4hYqpxqV9Py8psJ.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=eFFj2gS9UWs","https:\\/\\/www.youtube.com\\/watch?v=vUTEAYo7frA"]', 4.4, '2017-11-22', NULL),
(339877, 'Twój Vincent', 'Bohaterowie obrazów Vincenta van Gogha przedstawiają historię życia oraz tajemniczej śmierci artysty.', 33, 'http://image.tmdb.org/t/p/w500/qlrhwUDe7YOZujAYanK6ij2vbY5.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=47h6pQ6StCk","https:\\/\\/www.youtube.com\\/watch?v=2ZX7OANSoAg","https:\\/\\/www.youtube.com\\/watch?v=0CQKHWvK8Ro"]', 8.3, '2017-09-22', 0),
(481122, 'Pewnego razu w listopadzie', 'Marek (Grzegorz Palkowski) właśnie rozpoczyna studia prawnicze na Uniwersytecie Warszawskim. Ma piękną i odwzajemniającą jego uczucie dziewczynę, Olę (Alina Szewczyk). Zaś na co dzień troskliwie opiekuję się matką (Agata Kulesza), z którą mieszka w przedwojennej kamienicy. Kiedy w wyniku eksmisji rodzina traci dach nad głową, rozpoczyna się wyczerpująca tułaczka po Warszawie – między jedną noclegownią a drugą. W końcu Markowi udaje się wynegocjować miejsce w skłocie w centrum miasta. Szczęście bohaterów nie trwa długo, bo w stolicy właśnie rozpoczyna się manifestacja niepodległościowa. Do budynku, w którym znaleźli schronienie, próbuje wedrzeć się grupa agresywnych chuliganów. Wydarzenia, jakie rozegrają się w murach skłotu, odcisną niemożliwe do zatarcia piętno na życiu wszystkich bohaterów.', 2, NULL, NULL, 0, '2017-11-03', 92),
(406563, 'Naznaczony: Ostatni klucz', 'Ponownie spotkamy się z dr Elise Rainier, wybitną parapsycholożką, która zmierzy się z najbardziej osobistą i przerażającą historią w swej karierze – będzie musiała stawić czoła lękowi w swym rodzinnym domu.', 39, 'http://image.tmdb.org/t/p/w500/zRUZjHFsZggZprU6KetySrUZVE0.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=O06iFohvpYI"]', 7.5, '2018-01-03', 0),
(407451, 'Pułapka Czasu', 'Po zaginięciu ojca naukowca, trzy osobliwe istoty wysyłają jego córkę Meg oraz jej brata i przyjaciela, by go odnaleźli.', 3, 'http://image.tmdb.org/t/p/w500/30mYVdV8SWb2dDXgRCi30nMLnRm.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=AhrdVtJV0K4","https:\\/\\/www.youtube.com\\/watch?v=a_b1zVuzovI"]', 0, '2018-03-08', 0);
INSERT INTO `tmdbmovies` (`MovieID`, `Title`, `Description`, `Popularity`, `Poster`, `Trailer`, `vote_average`, `Premiere_date`, `runtime`) VALUES
(483465, 'Dwie korony', '"Dwie korony" to pierwszy film ukazujący nieznane dotąd powszechnie fakty z życia o. Maksymiliana Kolbe, począwszy od jego dzieciństwa, aż do heroicznej decyzji o oddaniu życia za współwięźnia w Auschwitz.  Zdjęcia dokumentalne zostały zrealizowane w Polsce, Japonii i we Włoszech. W warstwie fabularnej filmu występują znakomici polscy aktorzy: Adam Woronowicz, Cezary Pazura, Maciej Musiał, Antoni Pawlicki, Dominika Figurska, Sławomir Orzechowski i inni.  W części dokumentalnej wypowiadają się znawcy życia o. Maksymiliana: osoby duchowne i świeckie, między innymi Kazimierz Piechowski, który spotkał o. Maksymiliana w czasie pobytu w obozie, a słowa, które od niego wówczas usłyszał przemieniły go i ukierunkowały duchowo na całe życie...', 0, 'http://image.tmdb.org/t/p/w500/kf3DPlMRQV3NFPS8bZtjE87pacn.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=7KWEY8Q7F38"]', 0, '2017-10-13', 92),
(478326, 'Cicha noc', 'Adam, na co dzień pracujący za granicą, w Wigilię Bożego Narodzenia odwiedza swój rodzinny dom na polskiej prowincji. Z początku ukrywa prawdziwy powód tej nieoczekiwanej wizyty, ale wkrótce zaczyna wprowadzać kolejnych krewnych w swoje plany. Nikt z rodziny nie spodziewa się, jak wielki wpływ na życie ich wszystkich będą miały dalsze wydarzenia tej wigilijnej nocy.', 3, 'http://image.tmdb.org/t/p/w500/qEJsuFtYkXWVEa0Nvf90VjAZNOI.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=q45_2zlze98"]', 9, '2017-11-24', 97),
(470135, 'Atak paniki', '', 2, 'http://image.tmdb.org/t/p/w500/hr5OEDILYOrEhCFu5R0NHXegmDP.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=gLk32-LFpn4"]', 0, '2018-01-19', NULL),
(338970, 'Tomb Raider', 'Lara Croft to niepokorna córka ekscentrycznego podróżnika, który zniknął, gdy dziewczyna miała kilkanaście lat. Teraz, jako 21-letnia kobieta, podąża własną ścieżką, odmawiając spełnienia woli ojca, który chciał dla niej spokojnego życia. Zostawia wszystko za sobą i udaje się w ostatnie znane miejsce jego pobytu. Poszukując śladów, musi odnaleźć osławiony grobowiec na mitycznej wyspie u wybrzeży Japonii. Jeśli nie przezwycięży własnych lęków, może nie przeżyć niezwykle niebezpiecznej wyprawy. Jak wiele poświęci, by poznać tajemnicę zniknięcia ojca i zyskać miano tomb raidera?', 5, 'http://image.tmdb.org/t/p/w500/rcyPer7CGmDzWCczT4okv26clDj.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=enLIWGK9cC8","https:\\/\\/www.youtube.com\\/watch?v=8ndhidEmUbI"]', 0, '2018-03-14', 0),
(394830, 'Krucyfiks', 'Do więziennej celi trafia ojciec Anton, ksiądz, skazany za zabójstwo opętanej zakonnicy, nad którą sprawował egzorcyzmy. Jego sprawą interesuje się zdolna dziennikarka śledcza Nicole Rawlins. Reporterka nie przepuści żadnej okazji, aby pokazać światu daleko idące nieprawidłowości w działaniu organizacji kościelnej. Nicole wyrusza w podróż do niewielkiego miasteczka w odległej Rumunii, gdzie miały miejsce tajemnicze zdarzenia. Na miejscu okazuje się, że sprawa jest jeszcze bardziej skomplikowana niż wydawało się to na początku, a atmosfera zagęszcza się z każdą minutą. Dziennikarka dąży do poznania prawdy. Czy duchowny rzeczywiście zamordował chorą psychicznie osobę, czy też przegrał walkę z demoniczną obecnością?  [opis dystrybutora kino]', 8, 'http://image.tmdb.org/t/p/w500/ygZf1Y6iMJnFyYvp2JQW1SzqRpA.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=J_3tY1heBEM"]', 5.2, '2017-04-27', 90),
(463602, 'Slumber', '', 7, 'http://image.tmdb.org/t/p/w500/qbq02c1HqpXsuoZfc07ZOig8mqi.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=2ACktbmscxg"]', 5.2, '2017-12-01', NULL),
(371638, 'The Disaster Artist', '', 254, 'http://image.tmdb.org/t/p/w500/uCH6FOFsDW6pfvbbmIIswuvuNtM.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=4qab3TMg42k","https:\\/\\/www.youtube.com\\/watch?v=cMKX2tE5Luk"]', 7.5, '2017-11-30', NULL),
(359940, 'Trzy billboardy za Ebbing, Missouri', 'Samotna matka, która straciła córkę w wyniku morderstwa, wynajmuje trzy tablice reklamowe, umieszczając na nich prowokacyjny przekaz.', 16, 'http://image.tmdb.org/t/p/w500/vgvw6w1CtcFkuXXn004S5wQsHRl.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=Jit3YhGx5pU"]', 8.2, '2017-11-10', 0),
(284054, 'Czarna Pantera', 'T''Challa, nowy władca zaawansowanego królestwa Wakandy, musi bronić swojej ziemi przed rozdarciem przez wrogów z zewnątrz i wewnątrz kraju.', 12, 'http://image.tmdb.org/t/p/w500/hqww2V1EoPa7cs6mmoTE0iWlD0M.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=aqMgLl4De7U","https:\\/\\/www.youtube.com\\/watch?v=Tse6irtisNc"]', 0, '2018-02-12', 0),
(407445, 'Pełnia życia', 'Życie Robina było jak marzenie. Przystojny, błyskotliwy, odnoszący sukcesy młody mężczyzna, przykuwający uwagę kobiet, stojący u progu życiowego sukcesu. Aż trudno uwierzyć, że to wszystko przekreślić może jedna diagnoza brzmiąca jak wyrok: polio. Wyniszczająca choroba przykuwa Robina do szpitalnego łóżka, a w końcu doprowadza do para­liżu. Jak w takiej sytuacji odnaleźć siłę do walki? Gdzie szukać nadziei? [opis dystrybutora]', 13, 'http://image.tmdb.org/t/p/w500/1b2fUYxABGDFYrCXOWyhdNjEYbY.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=dqpfdS0SkZs"]', 7.1, '2017-10-13', 117),
(399360, 'Alpha', '', 4, 'http://image.tmdb.org/t/p/w500/pOTYsL5bGrNoUlStI9Q2AEuO27s.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=uIxnTi4GmCo"]', 0, '2018-03-01', NULL),
(300665, 'Leatherface', 'W zapomnianym przez świat szpitalu psychiatrycznym na amerykańskiej prowincji przetrzymywane są dzieci o zaburzeniach tak niebezpiecznych, że medycyna nie widzi dla nich ratunku. Przemoc fizyczna i psychiczna, gwałty i terror są tutejszą codziennością. Pewnego dnia grupa pacjentów ucieka, porywając młodą pielęgniarkę. Na ich czele stoi ten, który wkrótce krwawo zapracuje sobie na przydomek Leatherface. Tropem uciekinierów rusza ambitny i bezlitosny szeryf, który okaże się przeciwnikiem godnym najgorszego psychopaty. [opis dystrybutora kino]', 21, 'http://image.tmdb.org/t/p/w500/ia6KAi3mVo1ouukKj8oQTP2tdm2.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=wt8wybR4sfk"]', 5, '2017-09-14', 90),
