(446354, 'Czwarta władza', 'Dwoje wydawców dziennika "The Washington Post" staje na czele bezprecedensowego starcia amerykańskiej prasy z najwyższymi władzami, walcząc o prawo do ujawnienia szokujących tajemnic, przez cztery dekady ukrywanych przez amerykański rząd.', 96, 'http://image.tmdb.org/t/p/w500/5765ORvdKVX5bWmhEjjiOqLk3TH.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=BAZT3RttMR4"]', 6.3, '2017-12-22', 0),
