(10140, 'Opowieści z Narnii: Podróż Wędrowca do Świtu', 'Trzecia z cyklu ekranizacji słynnych książek C.S. Lewisa, zrealizowana w cyfrowej technice 3D.  Widowiskowa opowieść o wyprawie rodzeństwa Pevensie i księcia Kaspiana, którzy na pokładzie statku zwanego "Wędrowcem do Świtu" docierają do krainy, z której pochodzi lew Aslan.', 27, 'http://image.tmdb.org/t/p/w500/pRzEyrMSyvpHf92EhsVSg9Yr81t.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=hrJQDPpIK6I"]', 6.2, '2010-08-13', 113),
