(348350, 'Gwiezdne wojny – Historie: Han Solo', '', 9, 'http://image.tmdb.org/t/p/w500/xvCORNKtH84XoPBbFtgsJG6JxL6.jpg', NULL, 0, '2018-05-23', 0),
(416477, 'I tak cię kocham', 'Oparta na faktach historia związku urodzonego w Pakistanie komika i aktora komediowego Kumaila Nanjiani oraz Amerykanki Emily Gordon. Połączyła ich miłość od pierwszego wejrzenia, mimo dzielących oboje różnic kulturowych. Jednak na drodze do szczęścia staną rodzice dziewczyny oraz rodzina Kumaila ze swymi oczekiwaniami. A to dopiero początek wyzwań, jakim zakochani będą musieli stawić czoła. Gdy wydaje się, że cały świat - na czele z rodziną - sprzysiągł się, by zburzyć ich szczęście, to właśnie w sytuacjach pozornie bez wyjścia życie potrafi pokazać swoje najzabawniejsze oblicze.', 27, 'http://image.tmdb.org/t/p/w500/qquEFkFbQX1i8Bal260EgGCnZ0f.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=eNBUMLjGaBc"]', 7.6, '2017-06-23', 0),
(451044, 'Magiczna zima Muminków', 'To będzie wyjątkowa zima w świecie Muminków. Wyjątkowa, bo pierwsza. W śnieżnej, mroźnej Finlandii, którą zamieszkują, zazwyczaj zasypiają na zimę, by po obudzeniu powitać piękno wiosny i cieszyć się resztą roku. Czy Muminki będą niewyspane? Chyba nie, czeka je bowiem mnóstwo niespodzianek, a przede wszystkim pierwsze święta i magia gwiazdki.', 2, 'http://image.tmdb.org/t/p/w500/8xXt3jZQoy36ArzTmdhECGnvJGx.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=0jbgHqm1Djs"]', 0, '2017-11-23', 0),
