(299536, 'Avengers: Wojna bez granic', 'Avengersi łączą siły, aby zmierzyć się z tytanem Thanosem oraz będącą w jego posiadaniu rękawicą nieskończoności.', 26, 'http://image.tmdb.org/t/p/w500/84GK6kZMeexCJce0ljseMKnJVJL.jpg', '["https:\\/\\/www.youtube.com\\/watch?v=6ZfuNTqbHE8","https:\\/\\/www.youtube.com\\/watch?v=sAOzrChqmd0","https:\\/\\/www.youtube.com\\/watch?v=3VbHg5fqBYw"]', 0, '2018-04-25', 0),
